                "pageList": "timeList"
            },
            "deps": "js/dateTimeService"
        }
    },
    "data": {},
    "dataProviders": {
        "dataProviderTime": {
            "action": "loadData",
            "response": "{{data.pageList}}",
            "totalFound": "{{data.totalFound}}"
        }
    },
    "conditions": {},
    "onEvent": [],
    "lifecycleHooks": {
        "render": "render"
    },
    "props": {
        "prop": {
            "type": "field"
        }
    },
    "_viewModelId": "AwTimeVal",
    "_uniqueViewModelId": "AwTimeVal",
    "ctx": {}
};




/*
define component
*/
const Component = createComponent( declViewModelJson, awTimeValRenderFunction, undefined, ctxImportObj );

export default Component;
